import React from "react";
import Navbar from "./components/Navbar";

const App = () => {
  return (
    <div style={styles.container}>
      <h1 style={styles.heading}>Hi, I'm Levent, software engineer.</h1>
    </div>
  );
};

const styles = {
  container: {
    height: "100vh",
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
    background: "linear-gradient(to right, #00c9ff, #92fe9d)", // Cool blue-green gradient
    color: "white",
    textAlign: "center",
  },
  heading: {
    fontSize: "3rem",
    marginBottom: "1rem",
  },
  subheading: {
    fontSize: "1.5rem",
  },
};

export default App;
